const Modal = ({ item }) => {
  const {
    author,
    category,
    tags,
    content,
    description,
    title,
    views_count,
    image,
  } = item;
  console.log(item);
  return (
    <div className="modal">
      <div>{author}</div>
      <div>{category}</div>
      <div>{title}</div>
      <div>{description}</div>
      <img src={image} alt="" />
    </div>
  );
};

export default Modal;
